### 思路

逐位相加，从最后一位开始加起来，需要额外考虑剩余 1 的情况

### 代码

```javascript
/**
 * @param {number[]} num
 * @param {number} k
 * @return {number[]}
 */
var addToArrayForm = function (num, k) {
  let i = num.length - 1;
  let res = [];
  let carry = 0;
  while (i >= 0 || k !== 0) {
    const a = i >= 0 ? num[i] : 0;
    const b = k !== 0 ? k % 10 : 0;
    const sum = a + b + carry;
    carry = sum >= 10 ? 1 : 0;
    res.push(sum % 10);
    // 更新边界条件
    k = Math.floor(k / 10);
    i--;
  }
  if (carry) res.push(carry);
  return res.reverse();
};
```

