var addToArrayForm = function(num, k) {
    let result = []
    for(let i=num.length-1;i>=0;i--){
        let sum = num[i] + k % 10;
        k = Math.floor(k/10);
        if(sum >=10){
            sum-=10;
            k++;
        }
        result.push(sum)
    }
    while(k > 0){
        result.push(k % 10);
        k = Math.floor(k/10);
    }
    return result.reverse();
};
